 $('body').delegate('select[name=pc]','change',function(){
     var id = $(this).parents('.jform').parent().attr('id');
     var code 	= $(this).children('option:selected').val();
     var ctryname 	= $(this).children('option:selected').attr('data-name');
     var codename 	= $(this).children('option:selected').attr('data-abbr');
     // $('#'+id+' .jform input#code').val(codename+' +'+code);
     $('#'+id+' .jform input.cphonecode').val(codename+' +'+code);
     $('#'+id+' .jform input[name=ctry]').val(ctryname);
     $('#'+id+' .jform input[name=code]').val(code);
 });
 
 // Defualt Attribute for Validation
 $('[name="cn"],[name="msg"]').each(function(){$(this).attr({'minlength':'2'});});
 $('[name="cn"],[name="em"]').each(function(){$(this).attr('maxlength','60');});
 $('[name="msg"]').each(function(){$(this).attr('maxlength','1000');});
 $('[name="pn"],[name="apn"]').each(function(){$(this).attr({'minlength':'7','maxlength':'11'});});
 $('.SelectCountry.code').each(function(){$(this).attr({'id':'code'});});
 $('.SelectCountry.acode').each(function(){$(this).attr({'id':'acode'});});
 $('[name="cpwd"]').each(function(){$(this).attr('equalto','#'+$(this).parents('form').find('[name="pwd"]').attr('id'));});
 
 // Password No space
 $('input[type="password"]').keypress(function(e){if(e.which === 32)return false;});
 
 
